import React from 'react';

/**
 * @file module:src/components/customExpandedBox
 * @param {*} props
 * @returns 
 */

export default function CustomExpandedBox(props){
    
    console.log("field received",props.fieldValues);

    console.log("FIELD LIST",props.fieldsList);

    function getFiel(){
        return (
          this.myUserList.map((user,i)=>
            { 
              return ( 
            <TableRow
              id={user.user_id}  
              index={i}  
              userData={this.myUserList}    
            > 
            
                <td>{user.user_first_name}</td> 
                <td>{user.user_birth_date}</td>
                <td>{user.user_gender}</td>
    
                <td>{ user.currentJob.user_job_title ?  user.currentJob.user_job_title : ''}</td>
                <td>{ user.currentJob.user_job_salary && user.currentJob.user_job_salary_currency_symbol ?  user.currentJob.user_job_salary_currency_symbol +' '+ user.currentJob.user_job_salary : ''}</td>
                <td>{ user.currentAddress.user_address_city ?  user.currentAddress.user_address_city : ''}</td>
                
                <td onClick={(event)=>event.stopPropagation()}><button name="Botao" onClick={()=>this.showModal(user.currentCar)} >Visualizar</button></td>
                <td></td>
            </TableRow> 
            )}
        
        ) )
      };
    


    return (
        <div style={props && props.boxHeigt ? {...style.boxWrapper,height:props.boxHeigt} : style.boxWrapper}>
            <h1 style={style.extendedTitle}>{props && props.boxTitle ? props.boxTitle : ""}</h1>
            {getFieldData()}
        </div>

    )
} 

const style = {
    boxWrapper: {
        backgroundColor: "#d9d9d9",
        width: "100%", 
        height: "30%"
        
    },

    extendedTitle:{
        display: "flex",
        textAlign: "center",
        justifyContent: "center", 
        fontSize : "18px",
        color: "white",
        padding: "10px 2%"
    },

    boxText:{
        color: "#ffffff",
        padding: "20px 2%"
    }
}
